import styled from 'styled-components';

const Tag = styled.span`
padding:0.3em;
display:block;
position:sticky;
vertical-align:middle;
background-color: #3C343110;
border-radius: 7px;
margin-right:0.35em;
margin-left:0.35em;
white-space:nowrap;
[contenteditable]:read-only {
    cursor: not-allowed;
  }

text-align:center;
word-break: break-all;
`
const Index = (props) => {
    return <Tag content>{props.children}</Tag>; 
};
export default Index;
